import "./index.css";

const arreglo = [1, 2, 3, 4];
// arreglo.push(1);
// arreglo.push(2);
// arreglo.push(3);
// arreglo.push(4);

// No utilizar el push, utilizar el "spread"

let arreglo2 = [...arreglo, 5];
// los tres puntos ( ... ) es el operador spread

let arreglo3 = arreglo2.map();

console.log(arreglo);
console.log(arreglo2);
console.log(arreglo3);
